import { Link } from 'react-router-dom';

function Home() {
  return (
    <div>
      <h1>Citizen Engagement System</h1>
      <p>Welcome! Submit a complaint or track an existing one.</p>
      <p>
        <Link to="/submit">Submit Complaint</Link> | <Link to="/track">Track Status</Link> | 
        <Link to="/dashboard">My Dashboard</Link> | <Link to="/admin">Admin Dashboard</Link>
      </p>
    </div>
  );
}

export default Home;
